import React from 'react';
import { BrowserRouter as Router, Route } from "react-router-dom";

import Home from "./pages/home";
import LogIn from "./pages/login";
import SignUp from "./pages/signup";
import ProductKacang from "./pages/productkacang";
import DetailProductKacang from "./medium/detailproductkacang";
import ProductTraditional from "./pages/producttraditional";


const App = () => (
 <Router>
    <div>
      <Route exact path="/" component={Home}/>
      <Route exact path="/login" component={LogIn}/>
      <Route exact path="/signup" component={SignUp}/>
      <Route exact path="/productkacang" component={ProductKacang}/>
      <Route exact path="/producttraditional" component={ProductTraditional}/>
      <Route exact path="/detailproductkacang" component={DetailProductKacang}/>
    </div>
 </Router>
);

export default App;
